import SwiftUI

struct SVGView:View {
    let color1 = UIColor.fromHexString("#0A62BC")
    @State var endAmount:CGFloat = 0
    @State var isFilled = false
    let pathBounds = UIBezierPath.calculateBounds(paths: [.logo1, .logo2])
    var body: some View {
        ZStack {
           ShapeView(beizerPath: .logo1, pathBounds: pathBounds)
            //.stroke(Color(color1), lineWidth: 2)
            .trim(from: 0, to: endAmount)
           // .fill(Color(color1).opacity(isFilled ? 1: 0))
            
            ShapeView(beizerPath: .logo2, pathBounds: pathBounds)
             .trim(from: 0, to: endAmount)
            
        }.frame(width: 350, height: 350 * pathBounds.height / pathBounds
            .width)
        .onAppear {
            withAnimation(.easeInOut(duration: 2)) {
                self.endAmount = 1
            }
            withAnimation(Animation.easeInOut(duration: 2).delay(2)) {
                self.isFilled = true
            }
        }
    }
}


struct ShapeView: Shape {
    let beizerPath:UIBezierPath
    let pathBounds: CGRect
    
    
    func path(in rect: CGRect) -> Path {
        let pointScale = (rect.width >= rect.height) ? max(pathBounds.height, pathBounds.width) : min(pathBounds.width, pathBounds.height)
        let pointTransform = CGAffineTransform(scaleX: 1/pointScale, y: 1/pointScale)
        let path = Path(beizerPath.cgPath).applying(pointTransform)
        let multiplier = min(rect.width, rect.height)
        let transform = CGAffineTransform(scaleX: multiplier, y: multiplier)
        return path.applying(transform)
    }
}

extension UIBezierPath {
    static func calculateBounds(paths: [UIBezierPath]) -> CGRect {
        let myPaths = UIBezierPath()
        for path in paths {
            myPaths.append(path)
        }
        return myPaths.bounds
    }
    
    
    static var logo1: UIBezierPath {
        let shape = UIBezierPath()
        shape.move(to: CGPoint(x: 10, y: 6))
